// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract multiSigWallet {

// list of owners
    address[] public owners;
    uint public approval;

    constructor(uint amount) {
        // owners.push(msg.sender, 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2);
        owners = [msg.sender, 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2];
        approval = amount;
    }

    mapping(address => uint) ownerList;

    modifier onlyOwner {
        for(uint i = 0; i < owners.length; i++) {
            require(msg.sender == owners[i], "You're not the owner");
            _;
        }
    }



    function getOwner() public view returns(uint) {

